import React from 'react';
import './App.css';
import Nav from './component/Nav/Nav';
import Logo from './component/Logo/Logo';
import ImageLinkForm from './component/ImageLinkForm/ImageLinkForm';
import Rank from './component/Rank/Rank';
import Particles from 'react-particles-js';
import Clarifai from 'clarifai';

const app = new Clarifai.App({
		 apiKey: 'c75512e42bd64032b45f220afaf0ccb7'
});

const particlesOptions2 = {
	particles: {
		number: {
			value: 80,
			density: {
				enable: true,
				value_area: 800
			},
			shape: { 
				enable: true,
		        type: 'image',
		        stroke: {
		          width: 0,
		          color: '#000000'
		        }
		    }    
		}
	}
}

class App extends React.Component {
	constructor() {
  		super();
  		this.state = {
  			input: '',
  		}
  }

  onInputChange = (event) => {
  		console.log(event.target.value);

  		// this.setState({input: document.getElementById("input_url").value});
  		// console.log(this.state.input);
  }

  onButtonSubmit = (event) => {
	    console.log('click');

		app.models.predict("d02b4508df58432fbb84e800597b8959", 
			"https://i2-prod.mirror.co.uk/incoming/article14334083.ece/ALTERNATES/s810/3_Beautiful-girl-with-a-gentle-smile.jpg").then(
		    function(response) {
		    	console.log("OK");
		    },
		    function(err) {
		    	// There was an error
		    })
  }

  render() {
      return (
          <div>
         	  <Particles className='particles'
                params={particlesOptions2}/>
              <Nav />
              <Logo />
              <Rank />
              <ImageLinkForm onButtonSubmit={this.onButtonSubmit} onInputChange={this.onInputChange}/>
          </div>
        )
  }
}

export default App;
